    return (
        <>
            <div className="card">
                <div className="avatar">

                </div>
                <div className="data">

                </div>
                <div className="skill-list">

                </div>
            </div>
        </>
    )
}





// Render Zone
const root = ReactDOM.createRoot(document.getElementById("root"))
root.render(
    <App />
)
